// Piano samples for different registers
// This implementation provides multiple samples for different piano registers
// to achieve a more natural sound across the full range of notes.
// 
// C1 sample covers the lowest register
// C2 sample covers the low register
// C3 sample covers the low-mid register
// C4 sample covers the middle register
// C5 sample covers the mid-high register
// C6 sample covers the high register
// C7 sample covers the highest register
// C8 sample covers the extreme high register
//
// When playing a note, the system automatically selects the most appropriate
// sample based on the note's pitch, resulting in a more realistic piano sound.

// Function to verify the samples are different (call from console)
// Function to verify the samples are different and properly loaded (call from console)
function verifyPianoMultiSamples() {
    const samples = {
        C1: PIANO_C1_SAMPLE(),
        C2: PIANO_C2_SAMPLE(),
        C3: PIANO_C3_SAMPLE(),
        C4: PIANO_C4_SAMPLE(),
        C5: PIANO_C5_SAMPLE(),
        C6: PIANO_C6_SAMPLE(),
        C7: PIANO_C7_SAMPLE(),
        C8: PIANO_C8_SAMPLE()
    };
    
    console.log("%cPIANO MULTI-SAMPLE VERIFICATION", "background: #FF5722; color: white; font-size: 16px; padding: 5px;");
    
    // Log sample lengths
    Object.entries(samples).forEach(([note, sample]) => {
        console.log(`%c${note} Sample Length: ${sample.length}`, `color: ${getColorForNote(note)}; font-weight: bold;`);
    });
    
    // Calculate hashes for each sample
    const hashes = {};
    Object.entries(samples).forEach(([note, sample]) => {
        hashes[note] = simpleHash(sample);
    });
    
    console.log("%cSample Hashes:", "font-weight: bold;");
    Object.entries(hashes).forEach(([note, hash]) => {
        console.log(`%c${note} Hash: ${hash}`, `color: ${getColorForNote(note)};`);
    });
    
    // Check if samples are different
    const allHashes = Object.values(hashes);
    const uniqueHashes = new Set(allHashes);
    const samplesAreDifferent = allHashes.length === uniqueHashes.size;
    
    // Compare sample content at different positions
    const checkPositions = [100, 500, 1000, 5000, 10000];
    const sampleDiffs = [];
    
    checkPositions.forEach(pos => {
        const chars = {};
        let hasDifference = false;
        
        Object.entries(samples).forEach(([note, sample]) => {
            if (pos < sample.length) {
                chars[note] = sample.charAt(pos);
                // Check if this character is different from any previous one
                Object.entries(chars).forEach(([otherNote, otherChar]) => {
                    if (otherNote !== note && otherChar !== chars[note]) {
                        hasDifference = true;
                    }
                });
            }
        });
        
        if (hasDifference) {
            sampleDiffs.push({ position: pos, chars });
        }
    });
    
    if (samplesAreDifferent) {
        console.log("%cSUCCESS: All samples have different content - multi-sampling is working!", 
            "background: #4CAF50; color: white; font-size: 14px; padding: 3px;");
        
        if (sampleDiffs.length > 0) {
            console.log("%cSample differences found at positions:", "font-weight: bold;");
            sampleDiffs.forEach(diff => {
                console.log(`Position ${diff.position}:`, diff.chars);
            });
        }
    } else {
        console.log("%cWARNING: Some samples appear to be identical - you need to use different samples for each register", 
            "background: #F44336; color: white; font-size: 14px; padding: 3px;");
        console.log("To fix this issue, you need to replace each sample with a unique audio recording for each register.");
    }
    
    return {
        sampleLengths: Object.fromEntries(Object.entries(samples).map(([note, sample]) => [note, sample.length])),
        hashes,
        samplesAreDifferent,
        contentDifferent: sampleDiffs.length > 0
    };
}

// Helper function to generate colors for different notes
function getColorForNote(note) {
    const colors = {
        C1: "#1E88E5", // Dark blue
        C2: "#2196F3", // Blue
        C3: "#03A9F4", // Light blue
        C4: "#00BCD4", // Cyan
        C5: "#009688", // Teal
        C6: "#4CAF50", // Green
        C7: "#8BC34A", // Light green
        C8: "#CDDC39"  // Lime
    };
    return colors[note] || "#000000";
}

// Helper function to calculate a simple hash of a string
function simpleHash(str) {
    let hash = 0;
    for (let i = 0; i < Math.min(str.length, 1000); i++) {
        hash = ((hash << 5) - hash) + str.charCodeAt(i);
        hash = hash & hash; // Convert to 32bit integer
    }
    return hash;
}

